import React,{useState} from "react";
import { CircularProgress , Grid , Typography , MenuItem , FormControl , Select } from "@mui/material";
import { styled } from '@mui/system';

const ListContainer = styled('div')({
    padding: '25px',
  });

const FormController = styles(FormControl)({
    margin: theme.spacing(1), minWidth: 120, marginBottom: '30px',
  });

const List = () => {
    const [type,setType] = useState('restaurants');
    const [rating,setRating] = useState('');
    return (
        <ListContainer>
            <Typography variant='h4'>Restaurants , Hotels & Attractions around you</Typography>
            <FormControl className={classes.formContol}>
                <InputLabel>Type</InputLabel>
                <Select value={type} onChange={(e)=>setType(e.target.value)}>
                    <MenuItem value='restaurants'>Restaurants</MenuItem>
                    <MenuItem value='hotels'>Hotels</MenuItem>
                    <MenuItem value='attractions'>Attractions</MenuItem>
                </Select>
            </FormControl>

            <FormConrtol className={classes.formContol}>
                <InputLabel>Rating</InputLabel>
                <Select value={rating} onChange={(e)=>setRating(e.target.value)}>
                    <MenuItem value={0}>All</MenuItem>
                    <MenuItem value={3}>Above 3.0</MenuItem>
                    <MenuItem value={4}>Above 4.0</MenuItem>
                    <MenuItem value={4.5}>Above 4.5</MenuItem>
                </Select>
            </FormConrtol>
        </ListContainer>
    );
}

export default List;
